import React from "react";
import Image from "next/image";
import { Wrap } from "../styles/Cover";

function About() {
  return (
    <Wrap>
      <Image
        src="/cover-01.jpg"
        width={450}
        height={190}
        layout={"responsive"}
        className="cover-image"
      />
      <div className="cover-text">
        AAAA
      </div>

    </Wrap>
  );
}

export default About;
